import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

// Global Store
import {createStore} from 'redux'
import formErrorReducer, {GotFormErrorAction} from "./core/form-error.Actions";
import {Provider} from "react-redux";


export const store = createStore(formErrorReducer, window.__REDUX_DEVTOOLS_EXTENSION__&& window.__REDUX_DEVTOOLS_EXTENSION__());

/*store.subscribe(() => console.log(store.getState()));

store.dispatch(GotFormErrorAction(true));*/

ReactDOM.render(
  <React.StrictMode>
      <Provider store={store}>
          <App />
      </Provider>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
